import { Link, Outlet, Route, Router, Routes } from 'react-router-dom';
import './App.css';
import Cadastro from './componentes/cadastro';

function App() {
  return (
    
      <Router>
        <Routes>
          <Route path="/cardapio/cadastro" element={<Cadastro />} /> {/* Rota para o componente de Cadastro */}
          {/* ... Outras rotas ... */}
        </Routes>
      </Router>


   
  );
}

export default App;
